import React from 'react'
import Logo from '../assets/logo.png'

function navbar() {
    return (
        <div className="NavBar">
            <div className="LeftSide">
                <img src='Logo-opague-achtergrond-light-footer-kopie.png' />
               </div>
               <div className="RightSide"></div>
            </div>
    );
}
export default navbar;
